(62, '1-10', 'Photograps', '<p><i style=\"font-family: Nunito; font-size: 14px; text-align: justify;\">Maecenas in neque dolor. Mauris lacus mauris, vehicula et sapien ut, maximus dictum mauris. Aliquam pulvinar leo et purus tincidunt, sit amet tempus dui egestas. Fusce quis auctor ligula. Ut luctus velit et blandit dignissim. Aliquam ultricies congue lectus quis eleifend.</i><br></p>', '<p style=\"text-align: left; line-height: 1;\"><span style=\"font-size: 12px;\">Look at the example item below.</span></p><p style=\"text-align: right; line-height: 1;\"><span style=\"font-size: 12px;\">&nbsp;Sample Answer :a b </span><b style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-size: 12px;\">c</span></b><span style=\"font-size: 12px;\"> d</span></p><p style=\"text-align: center; line-height: 1;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"mejp.jpg\" style=\"width: 335px; height: 251.25px;\"></p><p style=\"text-align: left; line-height: 1;\"><span style=\"font-size: 12px;\">Now Listen to the four statements.</span></p><p style=\"text-align: left; line-height: 1;\"><span style=\"font-size: 12px;\">(A) They\'re leaving the room.</span></p><p style=\"text-align: left; line-height: 1;\"><span style=\"font-size: 12px;\">(B) They\'re turning on the machine</span></p><p style=\"text-align: left; line-height: 1;\"><span style=\"font-size: 12px;\">(C) They\'re standing near the table.</span></p><span style=\"font-size: 12px;\">(D) They\'re reading the newspaper.</span>', 'listening', 2, 'paket 1');
